contracts/providers/CardProvider.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity <=0.8.24;

import {ICard} from "../interfaces/ICard.sol";
import {Data} from "../libraries/Data.sol";
import {Hash} from "../libraries/Hash.sol";
import {ICardProvider} from "../interfaces/ICardProvider.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";
import {IERC721} from "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import {Card} from "../cards/Card.sol";
import {ExclusiveCard} from "../cards/ExclusiveCard.sol";

contract CardProvider is Ownable, ICardProvider {
    mapping(address => address) private _cards;
    mapping(address => address) private _exclusiveCards;

    constructor(address controller) Ownable(controller) {}

    function createCard(
        address streamer,
        string memory baseURI
    ) external override onlyOwner returns (address) {
        require(_cards[streamer] == address(0));

        Card card = new Card(address(this), baseURI);

        address cardId = address(card);
        _cards[streamer] = cardId;

        return cardId;
    }

    function createExclusiveCard(
        address streamer,
        string memory name,
        string memory symbol,
        uint256 mintPrice,
        string memory baseURI
    ) external override returns (address) {
        require(_exclusiveCards[streamer] == address(0));

        ExclusiveCard card = new ExclusiveCard(
            address(this),
            name,
            symbol,
            mintPrice,
            baseURI
        );

        address cardId = address(card);
        _exclusiveCards[streamer] = cardId;

        return cardId;
    }

    function getCard(
        address streamer
    ) external view override returns (address) {
        return _cards[streamer];
    }

    function getExclusiveCard(
        address streamer
    ) external view override returns (address) {
        return _exclusiveCards[streamer];
    }

    function mintCard(address cardId, address to) external onlyOwner {
        ICard(cardId).mint(to);
    }
}

contracts/providers/TipProvider.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity <=0.8.24;

import {Data} from "../libraries/Data.sol";
import {Hash} from "../libraries/Hash.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";
import {ITipProvider} from "../interfaces/ITipProvider.sol";

contract TipProvider is Ownable, ITipProvider {
    mapping(bytes32 => Data.Tip) private _tips;

    constructor(address controller) Ownable(controller) {}

    function start(
        address streamer
    ) external override onlyOwner returns (bytes32) {
        Data.Tip memory tip = Data.Tip({
            streamer: streamer,
            raisedAmount: 0,
            paused: false
        });

        bytes32 tipId = Hash.tipId(tip);

        _tips[tipId] = tip;

        return tipId;
    }

    function tipStreamer(
        bytes32 tipId,
        uint256 amount
    ) external override onlyOwner {
        Data.Tip storage tip = _tips[tipId];

        require(!tip.paused, "Data.Tip is paused");
        tip.raisedAmount += amount;
    }

    function pause(
        address streamer,
        bytes32 tipId
    ) external override onlyOwner {
        Data.Tip storage tip = _tips[tipId];

        require(streamer == tip.streamer, "Not owner");
        require(!tip.paused, "Data.Tip was already paused");

        tip.paused = true;
    }

    function isPaused(bytes32 tipId) external view override returns (bool) {
        return _tips[tipId].paused;
    }

    function raisedAmount(
        bytes32 tipId
    ) external view override returns (uint256) {
        return _tips[tipId].raisedAmount;
    }
}

contracts/Thurbe.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity <=0.8.24;

import {Data} from "./libraries/Data.sol";
import {Hash} from "./libraries/Hash.sol";
import {IThube} from "./interfaces/IThurbe.sol";
import {ICard} from "./interfaces/ICard.sol";
import {CardProvider} from "./providers/CardProvider.sol";
import {TipProvider} from "./providers/TipProvider.sol";
import {AccessControl} from "@openzeppelin/contracts/access/AccessControl.sol";
import {Pausable} from "@openzeppelin/contracts/utils/Pausable.sol";
import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Thurbe is IThube, AccessControl, Pausable {
    CardProvider private _cardProvider;
    TipProvider private _tipProvider;

    mapping(bytes32 => Data.Stream) private _streams;
    mapping(bytes32 => Data.Video) private _videos;
    mapping(address => Data.Streamer) private _streamers;

    IERC20 private _thurbeToken;

    constructor(address thurbeToken) {
        // Create providers.
        _cardProvider = new CardProvider(address(this));
        _tipProvider = new TipProvider(address(this));

        // Grant admin role.
        _grantRole(DEFAULT_ADMIN_ROLE, _msgSender());

        _thurbeToken = IERC20(thurbeToken);
    }

    function create(
        string memory cardBaseURI,
        string memory name,
        string memory symbol,
        uint256 mintPrice,
        string memory cardExlusiveBaseURI
    ) external override {
        address streamer = _msgSender();

        require(_streamers[streamer].createdAt == 0);

        _streamers[streamer] = Data.Streamer({
            totalUnClaimedTfuel: 0,
            totalClaimedTfuel: 0,
            totalUnClaimedThurbe: 0,
            totalClaimedThurbe: 0,
            createdAt: block.timestamp
        });

        _cardProvider.createCard(streamer, cardBaseURI);
        _cardProvider.createExclusiveCard(
            streamer,
            name,
            symbol,
            mintPrice,
            cardExlusiveBaseURI
        );

        emit StreamerCreated(streamer);
    }

    // === Streamer Functions ===
    function startStream(
        bytes32 streamId,
        bool exclusive,
        bool tips
    ) external override whenNotPaused {
        address streamer = _msgSender();

        address cardId = exclusive
            ? _cardProvider.getExclusiveCard(streamer)
            : _cardProvider.getCard(streamer);

        require(cardId != address(0), "Inclusive card not created");

        _startStream(streamId, streamer, cardId);

        if (tips) {
            _streams[streamId].tipId = _startTip(streamId);
        }
    }

    function uploadVideo(
        bytes32 videoId,
        bool exclusive,
        bool tips
    ) external override whenNotPaused {
        address streamer = _msgSender();

        address cardId = exclusive
            ? _cardProvider.getExclusiveCard(streamer)
            : _cardProvider.getCard(streamer);

        require(cardId != address(0), "Card not created");

        _startVideo(videoId, streamer, cardId);

        if (tips) {
            _videos[videoId].tipId = _startTip(videoId);
        }
    }

    function _startTip(bytes32 id) internal returns (bytes32) {
        address streamer = _msgSender();

        bytes32 tipId = _tipProvider.start(streamer);
        emit TipCreated(id, tipId);

        return tipId;
    }

    function pauseTip(bytes32 streamId) external whenNotPaused {
        address streamer = _msgSender();

        Data.Stream memory stream = _streams[streamId];
        require(stream.tipId != bytes32(0), "No stream tip");

        _tipProvider.pause(streamer, stream.tipId);

        emit StreamPaused(streamId);
    }

    function claimTfuel(uint256 amount) public override whenNotPaused {
        address streamer = _msgSender();

        Data.Streamer storage streamerData = _streamers[streamer];
        require(streamerData.totalUnClaimedTfuel >= amount, "Insufficient");

        payable(streamer).transfer(amount);

        streamerData.totalUnClaimedTfuel -= amount;
        streamerData.totalClaimedTfuel += amount;

        emit ClaimedTfuel(streamer, amount);
    }

    function claimThurbe(uint256 amount) public override whenNotPaused {
        address streamer = _msgSender();

        Data.Streamer storage streamerData = _streamers[streamer];
        require(streamerData.totalUnClaimedThurbe >= amount, "Insufficient");

        _thurbeToken.transfer(streamer, amount);

        streamerData.totalUnClaimedThurbe -= amount;
        streamerData.totalClaimedThurbe += amount;

        emit ClaimedThurbe(streamer, amount);
    }

    function claimAll() external override {
        address streamer = _msgSender();

        Data.Streamer storage streamerData = _streamers[streamer];

        claimTfuel(streamerData.totalUnClaimedTfuel);
        claimThurbe(streamerData.totalUnClaimedThurbe);
    }

    // === Viewers Functions ===
    function tipStream(
        bytes32 streamId,
        uint256 amount
    ) external whenNotPaused {
        address viewer = _msgSender();

        _thurbeToken.transferFrom(viewer, address(this), amount);

        Data.Stream memory stream = _streams[streamId];
        require(stream.tipId != bytes32(0), "No stream tip");

        _tipProvider.tipStreamer(stream.tipId, amount);

        Data.Streamer storage streamerData = _streamers[stream.streamer];
        streamerData.totalUnClaimedThurbe += amount;

        emit Tipped(streamId, viewer, amount);
    }

    function tipVideo(bytes32 videoId, uint256 amount) external whenNotPaused {
        address viewer = _msgSender();

        _thurbeToken.transferFrom(viewer, address(this), amount);

        Data.Video memory video = _videos[videoId];
        require(video.tipId != bytes32(0), "No stream tip");

        _tipProvider.tipStreamer(video.tipId, amount);

        Data.Streamer storage streamerData = _streamers[video.streamer];
        streamerData.totalUnClaimedThurbe += amount;

        emit Tipped(videoId, viewer, amount);
    }

    function mintCard(
        address streamer,
        address to,
        bool exclusive
    ) external payable override {
        address cardId = exclusive
            ? _cardProvider.getExclusiveCard(streamer)
            : _cardProvider.getCard(streamer);

        uint256 amount = msg.value;

        ICard card = ICard(cardId);
        require(amount >= card.getMintPrice());

        Data.Streamer storage streamerData = _streamers[streamer];
        streamerData.totalUnClaimedTfuel += amount;

        _cardProvider.mintCard(cardId, to);
    }

    function getCardId(
        address streamer,
        bool exclusive
    ) external view override returns (address) {
        return
            exclusive
                ? _cardProvider.getExclusiveCard(streamer)
                : _cardProvider.getCard(streamer);
    }

    // === Internal Functions ===
    function _startStream(
        bytes32 streamId,
        address streamer,
        address cardId
    ) internal {
        require(_streams[streamId].streamer == address(0));

        Data.Stream memory stream = Data.Stream({
            streamer: streamer,
            tipId: bytes32(0),
            cardId: cardId
        });

        _streams[streamId] = stream;

        emit StreamCreated(streamer, cardId);
    }

    function _startVideo(
        bytes32 videoId,
        address streamer,
        address cardId
    ) internal {
        require(_streams[videoId].streamer == address(0));

        Data.Video memory video = Data.Video({
            streamer: streamer,
            tipId: bytes32(0),
            cardId: cardId
        });

        _videos[videoId] = video;

        emit VideoCreated(streamer, cardId);
    }

    function pause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _pause();
    }

    function unPause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _unpause();
    }

    function getStreamer(
        address streamer
    ) external view override returns (Data.Streamer memory) {
        return _streamers[streamer];
    }

    function getStream(
        bytes32 streamId
    ) external view override returns (Data.Stream memory) {
        return _streams[streamId];
    }

    function getVideo(
        bytes32 videoId
    ) external view override returns (Data.Video memory) {
        return _videos[videoId];
    }
}

